pragma solidity ^0.6.0;

contract Mappings {

    mapping(uint => string) public names;

    // Treat this mapping like a database of names, where 
    // each key is an id (1, 2, 3...), and each value is 
    // a name ("Adam", "Bryan", "Carl"...).

    constructor() public {
        names[1] = "Adam";
        names[2] = "Bruce";
        names[3] = 'Carl';
    }

}
